import { FaHome, FaUsers ,FaStoreAlt,FaFolder  } from "react-icons/fa";
import { NavLink } from "react-router-dom";

const ListNav: { id: number; icon: any; to: string; title: string }[] = [
  {
    id: 1,
    icon: <FaHome />,
    to: "/home",
    title: "Dashboard",
  },
  {
    id: 2,
    icon: <FaUsers />,
    to: "/",
    title: "Customer",
  },
  {
    id: 3,
    icon: <FaStoreAlt />,
    to: "/",
    title: "Shop",
  },
  {
    id: 4,
    icon: <FaFolder />,
    to: "/",
    title: "Category",
  }
];

const Navbar = () => {
  return (
    <>
      {ListNav.map(
        (
          item: { id: number; icon: any; to: string; title: string },
          index: number
        ) => (
          <NavLink
            to={item.to}
            key={item.id}
            className="flex p-5 gap-x-10 items-center"
          >
            <div className="items-center text-[40px]">
              {item.icon}
            </div>
            <div className="text-[20px]">{item.title}</div>
          </NavLink>
        )
      )}
    </>
  );
};

export default Navbar;
